import React from "react";

const DUMMY_EVENTS = [
  { id: "h1", event: "Call Sasha" },
  { id: "h2", event: "message sasha" },
];

const Events = () => {
  return (
    <div>
      {DUMMY_EVENTS.map((event) => (
        <a href={`events/${event.id}`} key={event.id}>
          {" "}
          {event.event}{" "}
        </a>
      ))}
    </div>
  );
};

export default Events;
